  `net_state` int(1) NOT NULL DEFAULT '0' COMMENT '在线状态，0：离线，1：在线',
  `alarm_state` int(1) NOT NULL DEFAULT '0' COMMENT '报警状态，0：正常，1：报警',
  `sn` varchar(32) NOT NULL DEFAULT '' COMMENT '终端序列ID',
